function Start(idActor, flPrevHP, flHp)

Hydra.ActorDisable(Hydra.ActorsLinkedByActorInGroup(idSelf, "SWARMER_SPAWNER")[1]);

-- Despawn succubus at location 
Hydra.QActorEnableAI(idActor, false);
Hydra.QActorPower(idActor, FLY_AWAY_POWER);
Hydra.WaitForQEmpty(idActor);
-- Spawn shaman reinforcement further on the cliff
Hydra.ActorTriggerSpawnerUpdateInActorGroup("QST_Hell_Battlefield_Succubus_2")
-- Send event to move Horadrim across the ravine
Hydra.EventSend("Hell_Ambush_Progress")
-- Send event to move Horadrim across the ravine
Hydra.EventSend("Hell_Ambush_Finished")
end

function Start(idActorSpawned, idActorSpawner)

Hydra.ActorSetInvulnerable(idActorSpawned, true);
Hydra.ActorSetAILocalVariable(idActorSpawned, "ENCOUNTER", 1);
Hydra.ActorSetDamageCap(idActorSpawned, 0.7501)

Hydra.QActorPower(idActorSpawned, BARRIER_POWER, Hydra.ActorsLinkedByActorInGroup(idSelf, "BARRIER_LOCATION")[1]);
Hydra.QActorPower(idActorSpawned, MORTAR_RAIN);

Hydra.ActorEnable(Hydra.ActorsLinkedByActorInGroup(idSelf, "SWARMER_SPAWNER")[1]);
end

